import React from 'react';
import paymentAmex from '../assets/images/payment-amex.png';
import paymentKhan from '../assets/images/payment-khan.png';
import paymentVisa from '../assets/images/payment-visa.png';
import paymentMastercard from '../assets/images/payment-mastercard.png';
import paymentGray from '../assets/images/payment-mastercard.png';

class Footer extends React.Component {
	render(){
		return (
			<div className="container">
				<div className="row">
					<div className="col-md-4">
						<p>shopy &copy; 2015. your copyright here</p>
					</div>
					<div className="col-md-6">
						<ul>
							<li>about us</li>
							<li>contact us</li>
							<li>support</li>
							<li>our feed</li>
							<li>terms and conditions</li>
							<li>our privacy</li>
							<li>join us</li>
							<li>live support</li>
						</ul>
					</div>
					<div className="col-md-2">
						<h4>payment methods</h4>
						<ul>
							<li><a href="#"><img src = {paymentMastercard} /></a></li>
							<li><a href="#"><img src = {paymentMastercard} /></a></li>
							<li><a href="#"><img src = {paymentMastercard} /></a></li>
							<li><a href="#"><img src = {paymentMastercard} /></a></li>
							<li><a href="#"><img src = {paymentMastercard} /></a></li>
						</ul>
					</div>
				</div>
			</div>
		)
	}
}

export default Footer;
